export type FartKey = keyof typeof FARTS_REQ;

// Helper: convert original dataset "filename" into the key used above
export function toFartKey(filename: string): FartKey | undefined {
  const base = filename.replace(/\.[^.]+$/, '').replace(/[^\w]+/g, '_');
  return (base in FARTS_REQ) ? (base as FartKey) : undefined;
}
